INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `excerpt`, `layout`, `meta_keyword`, `meta_description`, `category`, `tag`, `featured_image`, `author`, `priority`, `status`, `created_at`, `updated_at`, `schedule_at`) VALUES
(1, 'Privacy Policy', 'privacy-policy', '<p>As a company that gives great importance to the privacy of our users and members, we make sure to implement the following policies:</p>\n\n	    					<h4>Sharing of Information</h4>\n	    					<ul>\n		    					<li>Any part of your information will not be shared with any third party websites.</li>\n								<li>We rest assure that any information you input on our website will be used correctly.\n								</li><li>We will not be using your contact information without your prior knowledge, and therefore will only be used with your permission. This information will be utilized solely to personalize your experience with our company and for us to reach out to you when you need us. </li>\n							</ul>\n\n							<h4>Accessing of your Information</h4>\n							<ul>\n								<li>Only people with proper authorization will be able to access any of your data.</li>\n								<li>All necessary preventative measures will be taken to keep every piece of your information accurate and updated.</li>\n								<li>We will always ask for your permission before using any of your information.</li>\n							</ul>\n\n\n							<h4>Changes to our Privacy Policy</h4>\n							<ul>\n								<li>We reserve the right to make any updates and modifications to our policy. This can happen anytime, but we will notify our customers by posting a statement on our homepage regarding these changes.</li>\n								<li>We will also show the date in which these changes will be effective.</li>\n								<li>Customers that continue subscribing to our services means that they have acknowledged and confirmed their acceptance of the changes in this policy.</li>\n							</ul>\n\n							<h4>Your Consent</h4>\n							<p>We would like to remind every visitor that when you visit our site and use any of our services, you automatically agree to our privacy policy regardless if you are a searcher or a member. </p>\n							<p>You may visit our contact us page if you have some questions regarding our Privacy Policy and other queries regarding our company.</p>', NULL, 'page', '24 Hour Emergency Locksmith, Residential Locksmith Service, Commercial Locksmith Service, Automotive Locksmith Service, Emergency Locksmith Service, Industrial Locksmith Service', 'We are a directory of 24 hour locksmith company servicing residential, commercial, automotive, industrial and emergency situation.', NULL, NULL, NULL, 'admin', 0, 1, '2017-07-20 00:00:00', NULL, '0000-00-00'),
(3, 'Contact Us', 'contact-us', '<p>Contact us for any of your concerns; we accept your comments, recommendations, and suggestions regarding the services we provide here at LocksmitHub.</p>', NULL, 'page', '24 Hour Emergency Locksmith, Residential Locksmith Service, Commercial Locksmith Service, Automotive Locksmith Service, Emergency Locksmith Service, Industrial Locksmith Service', 'We are a directory of 24 hour locksmith company servicing residential, commercial, automotive, industrial and emergency situation.', NULL, NULL, NULL, 'admin', 0, 1, '2017-08-04 05:14:32', NULL, '0000-00-00'),
(19, 'Advantages of Hiring the Best Locksmith Company  in a Car Lockout Situation', 'advantages-of-hiring-the-best-locksmith-company-in-a-car-lockout-situation', '<p>You might laugh at yourself when you realized that your car has automatically locked with the keys inside your vehicle, and what&rsquo;s worse is, you do not have a spare key! That&rsquo;s when the panic and anxiety kick in. Leaving your keys inside a locked car might be the least of your concern but ending up in this kind of situation is no fun and would surely get the best out of you.</p>\r\n<p>In this blog, we are going to talk about the advantages of hiring a professional locksmith in case of an emergency car lockout rather than having someone without experience in dealing with the predicament. Some locks are just complicated most especially to someone without proper training or skills.</p>\r\n<p><strong>Easy and Convenient</strong><br />First of all, there is no denying that locksmith experts are the best people to call as soon as you got problems with either your locks at home, car keys, office locks, safes, commercial cabinet locks and much more. But then, there are still a few people who do not know or fully understand the ease of having a locksmith contact at all times.</p>\r\n<p><strong>24 Hour Availability</strong><br />Though, you&rsquo;ll never wish a lockout would happen to you; for the good part, you won&rsquo;t have to worry when you know there is an available assistance at any hour of the day. What you need to do is store the contact numbers of the best locksmiths in your area, so you have a peace of mind.</p>\r\n<p><strong>Locksmiths are the best at any Lock</strong><br />Locksmith technicians spent so much time training and developing their skills and talents in locksmithing. Not only that, they have the right tools and has learned every method to get you out of a lockout trouble. Thus, when you hire a locksmith expert work with your locks, you surely get the solution best fitted to your current dilemma whether it is a lockout at home, office or car.</p>\r\n<p>While calling one of your relatives or friends might seem to be the best solution, it is still always a smart choice to call the professionals in the field. They are your family in case of a locksmith trouble because that''s what they do and that is their purpose! - To help anyone in an emergency lockout.</p>', 'You might laugh at yourself when you realized that your car has automatically locked with the keys inside your vehicle, and whats worse is, you do not have a spare key! Thats when the panic and anxiety kick in.', 'post', 'automotive locksmiths, locksmith professionals, car lockouts', 'Some locks are just complicated most especially to someone without proper training or skills. Thus, calling the experts is the best option.', 'a:1:{i:0;s:13:"Uncategorized";}', 'automotive locksmith', NULL, 'admin', 0, 1, '2017-09-04 02:59:53', '2017-09-07 03:16:22', '0000-00-00'),
(28, 'What are the Easy Ways to Improve the Security of Your Home?', 'what-are-the-easy-ways-to-improve-the-security-of-your-home', '<p>Our home should be our haven from the cruel world outside. It&rsquo;s the place we should be living peacefully and protected at all time. That&rsquo;s why we have to make sure that your home is well-protected and won&rsquo;t be an easy target for unwanted guests whether it is day or night. Read on to learn to improve your security.</p>\r\n<ol>\r\n<li>A burglar''s best friend is the dark. The way they see your dark house is a beacon or a sign that said, &ldquo;Burglars are all welcome!&rdquo;. To avoid this, try installing motion sensor lights that can illuminate the front and back part of your home. They are a great way to repel burglars off.</li>\r\n<li>If you love dogs, then this is a great advantage of improving your security. A burglar always operates quietly to avoid getting spotted. And what&rsquo;s worse than getting barked at in the middle of the night while all the residents sleep. It&rsquo;s up to you on what kind of dog would you want to be best friends with; even a small dog can scare a burglar with high-pitched barks.</li>\r\n<li>Fool them with security decals even if you don&rsquo;t have a security system. A burglar will move on rather than risking his freedom when he knows you might have a security system. Even putting on some scary signs like having a ferocious dog will lessen the chance of a break-in.</li>\r\n<li>A very effective way of improving your security is to have the ability to see everything. At low-prices, there are security cameras widely available in the market that can even be installed by yourself.</li>\r\n<li>In case there&rsquo;s a break-in, security alarms are a great help. You can install them in the interiors of each room or on the exterior of your house. There are a lot of options and types of security alarms to choose from such as window or door activation, to infrared sensors. Once the alarm goes off, it&rsquo;s over for the bad guys.</li>\r\n</ol>\r\n<p>With all these in mind, you can rest assured that your premise will be a difficult target of burglary.</p>\r\n<p>&nbsp;</p>', 'Our home should be our haven from the cruel world outside. Its the place we should be living peacefully and protected at all time. Thats why we have to make sure that your home is well-protected and wont be an easy target for unwanted guests whether it is day or night. Read on to learn to improve', 'post', 'home security, residential locksmith, secure your property', 'Our home should be our haven from the cruel world outside. Its the place we should be living peacefully and protected at all time.', 'a:1:{i:0;s:21:"Residential Locksmith";}', 'home security, improve security of home', NULL, 'admin', 0, 1, '2017-09-07 07:11:20', '2017-09-19 00:29:54', '0000-00-00'),
(31, 'Locksmith Mistakes That Can Be Easily Avoided', 'locksmith-mistakes-that-can-be-easily-avoided', '<p>Locksmiths are meant to help people that are having issues with their locks especially in a locked out situation. People tend to call any locksmith they could find not knowing how they can fall to a victim of scam and fraud. Don&rsquo;t be one of these people and be smart. You may know it, but some of these tips will help you avoid potential locksmith scams.</p>\r\n<p>It&rsquo;s a major mistake not to ask about their credentials. Not knowing if they are certified and you decided to hire them is a huge mistake. Being certified means a lot of training, experiences, skills, and education in the field. He may be an expert but not being certified can result to damage of your locks or keys rather than fixing them. You could even hire a person with a criminal record giving him access to your home or car.</p>\r\n<p>Choosing a locksmith company without doing any research is an amateur mistake. There are a lot of companies competing with each other, and it&rsquo;s challenging to find which is the perfect one. And choosing the wrong one can lead to devastating results. Though doing an extensive-research is not necessary, all you have to do is know about their services, reputation, their years in the industry, and experiences. Or better yet, call the company and ask them about these qualifications. Ask about their tools and equipment and if they are capable of dealing with modern lock security systems. If they can&rsquo;t answer your questions, better move on and find another. You&rsquo;ll have to follow your gut feeling before choosing one. Take your time and choose what makes you confident and comfortable.</p>\r\n<p>If you forgot to ask for a quote before the service and the service is done, you may already have fallen into a scam. A client that didn''t ask for a quote will be an advantage for them as they can charge higher at the end of the service. To avoid this, ask for several quotes over the phone. When you found the one the suits you, the quote should be written to avoid locksmiths that charge you more than the initial quote.</p>\r\n<p>&nbsp;</p>', 'People tend to call any locksmith they could find not knowing how they can fall to a victim of scam and fraud. Dont be one of these people and be smart.', 'post', 'locksmith services, call the right locksmith, locksmith tips', 'Choosing a locksmith company without doing any research is an amateur mistake. There are a lot of companies competing with each other, and its challenging to find which is the perfect one.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmith tips', NULL, 'admin', 0, 1, '2017-09-10 23:47:51', NULL, '0000-00-00'),
(34, 'Protecting Your Home While on Vacation', 'protecting-your-home-while-on-vacation', '<p>Excited to go to the beach and take a vacation from the countless paperwork from your annoying boss? Or can&rsquo;t wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But don&rsquo;t forget about the security of your home. If no one can watch it for you, try these tips on how to protect your home while on vacation.</p>\r\n<p>The most efficient way of keeping your home safe is asking for a trusted person to watch over your house. It could be your neighbors, family, or friends to look out for your home while you&rsquo;re gone.<br />Installing timers on your lights and devices can make your home look occupied. Setting a specific or random time will less likely get robbed especially when someone thinks there&rsquo;s an activity happening.<br />A front porch with piled up newspapers or mails is a clear sign that no one is home. The best thing you can do is to hold off deliveries by asking your delivery service. Or if you feel confident with your neighbors, you could ask them to pick your packages, mails, and newspapers for you.</p>\r\n<p>If you are going to be out for a long time, make sure to ask someone who can trim your grass and shrubs. Neglection is the perfect way to attract burglars. Well-maintained plants can give the impression that someone is home.</p>\r\n<p>Lock up everything.It&rsquo;s common sense. Even if you have the most advanced security measures, it&rsquo;s still safe to lock everything. Go to your house and lock everything from all the doors outside and inside to the windows from top to bottom. Even your garage doors should lock up.</p>\r\n<p>Even when you&rsquo;re away, you can even protect your home from your fingertips when you&rsquo;re using your mobile phone. It&rsquo;s simple but never announce your trip in social media. It&rsquo;s better just to be quiet and resist the temptation of showing off your photos. Think first before uploading because it&rsquo;s the same when telling the world that you&rsquo;re not home.</p>', 'Cant wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But dont forget about the security of your home. ', 'post', 'home security, residential locksmith, locksmith services', 'Cant wait for to go on your honeymoon with your partner in a perfect destination? Wherever we are going, we all need to go on a vacation to take a break and unwind once in a while. But dont forget about the security of your home. ', 'a:1:{i:0;s:21:"Residential Locksmith";}', 'home locksmith,home security', NULL, 'admin', 0, 1, '2017-09-12 02:56:20', NULL, '0000-00-00'),
(35, '5 Interesting Facts About Locksmiths', '5-interesting-facts-about-locksmiths', '<p><span style="font-weight: 400;">The first thing that comes to our mind whenever we hear the word &ldquo;Locksmith&rdquo; is working with keys. They are the first person we call when we&rsquo;re having troubles with our locks most especially for lock outs. And that&rsquo;s the only thing we think of them when it&rsquo;s all about locksmiths, working with locks and keys. We have to admit that it&rsquo;s not that interesting but here are some interesting facts that might change your opinions about locksmiths.</span></p>\r\n<ol>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">Harry Houdini was a locksmith. One of the most famous magicians and escape artists Harry Houdini was once a locksmith. Before he got famous for escaping out of handcuffs under water, Houdini began to work as an apprentice to a locksmith at the age of 11. Because of his talent in picking any locks, this would later become his signature stunt to become one of the world&rsquo;s greatest magician.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">It is one of the oldest professions. It was believed that locksmiths started 4000 years ago in Egypt and Babylon. One of the earliest evidence claimed that locksmiths started around 2500 BC that used to protect the tombs of a ruler named Khafre in the pyramid of Giza. Over the years, locksmithing has evolved through thousands of years making it an ancient yet respected profession in history.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">King Louis XVI of France was betrayed by a locksmith. Unusual for a king, Louis XVI was interested about locks. He befriended a royal locksmith Francois Gamain and had taught him to build locks from scratch. Even to the fact that the king&rsquo;s wife warned him, Gamain betrayed the king after 20 years of friendship to the revolutionaries by exposing a chest full of important documents that would help in overthrowing the king.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">The oldest lock found was from 4000 BC. The earliest lock was found by archeologists in Khorsabad Palace in Iraq. It&rsquo;s almost the same concept of modern day locks except that it was made entirely from wood.</span></li>\r\n<li style="font-weight: 400;"><span style="font-weight: 400;">A diver and a Locksmith. Charles Courtney was a diver that opens safe deep underwater for 400 feet. Because of his talent, he had recovered over millions of dollars for salvaged companies giving him fame internationally as a Master Locksmith.</span></li>\r\n</ol>', 'The first thing that comes to our mind whenever we hear the word Locksmith is working with keys. They are the first person we call when were having troubles with our locks most especially for lock outs.', 'post', 'locksmiths, history of locksmiths', 'The first thing that comes to our mind whenever we hear the word Locksmith is working with keys. They are the first person we call when were having troubles with our locks most especially for lock outs.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmiths', NULL, 'admin', 0, 1, '2017-09-14 04:20:55', NULL, '0000-00-00'),
(36, 'Is Locksmith a Scam?', 'is-locksmith-a-scam', '<p>When you get locked out of your home or car, and you can&rsquo;t find your keys, the first thing you could do is to call a locksmith. But something made you hesitate before dialing the number of a locksmith. Then you suddenly remembered all the things you heard about their reputation of being a fraud and a scam.</p>\r\n<p>It&rsquo;s a common misconception that all locksmiths are scammers and frauds. But it&rsquo;s not always true because honest locksmiths are just difficult to find. Some locksmiths are not even professionals but charge you high with their easy service that you could even do it by yourself. It&rsquo;s the same thing from other professionals, they offer quality services, but their rates are too high.</p>\r\n<p>Anyone can lock a pick, and anyone can make a pretty convincing website. If it''s true on what they claim on their website and you&rsquo;re too naive that you chose this type of locksmith, then you just have been trapped from a spider&rsquo;s web.</p>\r\n<p>But with the correct research and a few series of questions, you can distinguish the difference between a fraud locksmith and a professional locksmith. People who say that all locksmiths are scams are not fully aware on how to choose the perfect locksmith. That&rsquo;s why they get ripped-off or scammed rather than getting the quality service they need.</p>\r\n<p>But sometimes, we feel like getting ripped-off even though we&rsquo;ve chosen the perfect locksmith. When we&rsquo;ve tried several ways in opening a locked door and can&rsquo;t be opened, we tend to get frustrated until to the point we have to call a locksmith. Then just a few minutes, your lock was opened by a locksmith with the use of a simple tool and a few fiddling. It&rsquo;s like being overcharged when our hard earned money was taken away because of a simple job.</p>\r\n<p>But it&rsquo;s not unfair. You think that the job was so simple but in reality, it was not. You have to understand that being a locksmith requires skill, experience, and practice. Many people don&rsquo;t understand these that is why they think they&rsquo;re getting ripped-off. If the job is done fast and perfectly, that means your locksmith is an expert.</p>\r\n<p>So if you think all locksmiths are scammers, then you&rsquo;re just one of those ignorant customers. Honest locksmiths have been taken for granted because not many people appreciate the things they do. When you picked the perfect locksmith, then you&rsquo;re lucky enough of not being scammed. All you have to do is appreciate their service because they&rsquo;re the one who can ensure your safety and security with your locks.</p>\r\n<p>&nbsp;</p>', 'When you get locked out of your home or car, and you cant find your keys, the first thing you could do is to call a locksmith. But something made you hesitate before dialing the number of a locksmith. Then you suddenly remembered all the things you heard about their reputation of being a fraud and ', 'post', 'locksmith scam, locksmith misconceptions', 'Its a common misconception that all locksmiths are scammers and frauds. But its not always true because honest locksmiths are just difficult to find. Read on to learn more.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmith scam', NULL, 'admin', 0, 1, '2017-09-19 00:39:02', NULL, '0000-00-00'),
(37, 'Submit Your Business', 'submit-your-business', '<p>Submit your business to for inclusion in the most comprehensive lists of locksmith companies on LocksmitHub Local Locksmith Directory.</p>', 'Submit your business to for inclusion in the most comprehensive lists of locksmith companies on LocksmitHub Local Locksmith Directory.', 'page', 'Submit your business to for inclusion in the most comprehensive lists of locksmith companies on LocksmitHub Local Locksmith Directory.', 'Submit your business to for inclusion in the most comprehensive lists of locksmith companies on LocksmitHub Local Locksmith Directory.', NULL, NULL, NULL, 'admin', 0, 1, '2017-09-27 03:41:38', NULL, '0000-00-00'),
(38, 'How to Choose The Perfect Locksmith to Work on your Security', 'how-to-choose-the-perfect-locksmith-to-work-on-your-security', '<p>It&rsquo;s easy to get scammed nowadays especially when you&rsquo;re not aware. Many people have been victims of fake locksmith scams like mainly, getting overcharged when the job is simple enough. Or paying a locksmith that couldn&rsquo;t even get the job done. There are a lot of ways to get scammed, and you shouldn&rsquo;t be one of the many to get scammed.</p>\r\n<p>It&rsquo;s difficult to tell the difference between a fake and a legitimate locksmith since anyone can pick locks. But you can able to tell the difference between the two when a professional locksmith can do all types of locks without doing any damages. The key to choosing the best locksmith is doing your research beforehand. This is an advantage when having an emergency because you would be ready with the number of a locksmith. While looking for a locksmith during an emergency will not help you get the perfect one because of the rush.</p>\r\n<p>When doing research, make sure that all the locksmiths you&rsquo;re going to choose are certified. Being certified means having high-level skills and the knowledge because it is a highly specialized career. Your security and protection all depend on how they can properly install or repair locks, and they&rsquo;re the one who will keep your home and business secure. They should have the training and expertise when it comes to security. Ask about their credentials like their experiences, years in the business, their reputation, and services.</p>\r\n<p>Always choose the company that has 24 hours emergency services because you&rsquo;ll never know when you&rsquo;re going to need them. Make sure also that they have a wide range of services for all types of locks whether for residential, commercial, and automotive because it&rsquo;s not only your home will have problems about locks.</p>\r\n<p>Ask upfront for a quote or estimates. If they have given you estimates but has increased before the service, it&rsquo;s clear that they&rsquo;re not the one to choose. Pricing depends upon the services and the types of locks you have. Thus, it&rsquo;s best to ask for a quote before availing their services.</p>\r\n<p>When in doubt, don&rsquo;t think twice about calling the company. It&rsquo;s them who you will entrust the protection of your home or business. If you have any questions, don&rsquo;t hesitate to ask. You have to feel comfortable when you trust a locksmith. Otherwise, don&rsquo;t choose until you are fully satisfied with what you choose.</p>\r\n<p>&nbsp;</p>', 'Its easy to get scammed nowadays especially when youre not aware. Many people have been victims of fake locksmith scams like mainly, getting overcharged when the job is simple enough.', 'post', 'locksmith expert, the best locksmith, choosing the best locksmith', 'Its easy to get scammed nowadays especially when youre not aware. Many people have been victims of fake locksmith scams like mainly, getting overcharged when the job is simple enough.', 'a:1:{i:0;s:13:"Uncategorized";}', 'locksmith expert, the best locksmith, choosing the best locksmith', NULL, 'admin', 0, 1, '2017-10-12 04:21:03', NULL, '0000-00-00'),
(39, 'Is your home at risk of a break-in?', 'is-your-home-at-risk-of-a-break-in', '<p><span style="font-weight: 400;">Worried that your home might get robbed anytime soon? Is your home says open invitation for burglars and robbers to break in? If your gut tells you that your home is a beacon that sends signals to burglars, then you might be right. Here are known common facts on why your home can be a potential break-in.</span></p>\r\n<ol>\r\n<li><span style="font-weight: 400;">Depending on the landscape of your house, it can attract burglars if you have trees, hedges, or bushes that provide hiding spots. They may make your home look beautiful but can attract burglars.</span></li>\r\n<li><span style="font-weight: 400;">Newspapers and mails are piling up. When they are starting to pile up on your mailbox or front porch, it tells that there are no occupants to take them in. </span></li>\r\n<li><span style="font-weight: 400;">Tall grass and trash bins. Unmowed lawn and trash bins that are full is a sign of occupants in vacation. </span></li>\r\n<li><span style="font-weight: 400;">Sure, curb appeal is attractive but showing off that you&rsquo;re wealthy can invite unwanted guests inside. Fancy exteriors with a colorful paint job of your house or appealing ornaments only increase the risk of having a break-in.</span></li>\r\n<li><span style="font-weight: 400;">Security measures are hidden. If you own an advanced security system, it&rsquo;s better to let them know that you have one than hiding it. It&rsquo;s much safer than letting them try to enter even if you have security measures.</span></li>\r\n<li><span style="font-weight: 400;">A home that has no light turned on in the middle of the night is a magnet for burglars. It shows that there is no activity going on making it look like there&rsquo;s no one home. Even a home that is dark even outside is the perfect place for a burglary to happen.</span></li>\r\n<li><span style="font-weight: 400;">Spare keys are hidden in spots you think that are not obvious. You may think no one else will find your spare key under that rock or above the gutter but experienced burglars can find these keys whenever you hide them.</span></li>\r\n</ol>', 'Worried that your home might get robbed anytime soon? Is your home says open invitation for burglars and robbers to break in?', 'post', 'residential locksmith, home safety', 'Worried that your home might get robbed anytime soon? Is your home says open invitation for burglars and robbers to break in?', 'a:1:{i:0;s:21:"Residential Locksmith";}', 'residential locksmith, home safety', NULL, 'admin', 0, 1, '2017-10-13 04:57:56', NULL, '0000-00-00'),
(40, 'Lock Change Service', 'lock-change-service', '<h3>Changing The Locks On A Rental Property</h3>\r\n<p>Many people don&rsquo;t realize the danger of moving into a new rental property. Sure, it would feel great because of a new beginning, but because a rental property has been with many previous tenants, you never know how many copies of the key of your lock were distributed to their friends, family, and whatnot. These distributed keys will provide access for unwanted guests to your place, compromising your safety and security.</p>\r\n<p>As of now, there is no exact law about landlords replacing locks when a new tenant moves in. But it is required for every tenant moving out of the property; the key must be surrendered to the landlord or property management. But even though the previous tenant returned the key, copies of this key are floating around waiting for your property to be opened by someone you don&rsquo;t know.</p>\r\n<p>So when you move into a new property, make sure to change your locks. But before doing so, you have to discuss this matter with your landlord or property management. You&rsquo;ll have a good chance to allow you to change your locks because they want to assure you that their building is safe and want to make you feel comfortable. You just have to make sure that your newly replaced lock&rsquo;s key has a copy for your landlord.</p>', 'When you move into a new property, make sure to change your locks. But before doing so, you have to discuss this matter with your landlord or property management. ', 'page', 'Lock Change Service, Changing The Locks On A Rental Property', 'When you move into a new property, make sure to change your locks. But before doing so, you have to discuss this matter with your landlord or property management. ', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:45:26', '2017-10-17 04:49:17', '0000-00-00'),
(41, 'Car Key Replacement', 'car-key-replacement', '<h3>Electronic Keys For Cars Replacement</h3>\r\n<p>It&rsquo;s frustrating when a car lockout occurs especially when it is at the most inconvenient time. Like for example, you&rsquo;re late for a meeting, and suddenly, your electronic keys don&rsquo;t work anymore with your car.</p>\r\n<p>Electronic keys have become high-tech to improve the security of a car. Newer models of vehicles today features keys that have their transponder to communicate their matching cars. A car won&rsquo;t be able to start if the key used doesn''t match.</p>\r\n<p>This can be very bothersome in case your key got lost. You can solve this issue by going to a dealer to have your key replaced and programmed that could cost up to $200-$500 depending on the brand and model.</p>\r\n<p>If you want the less-expensive approach, you can find a replacement online that could cost only up to less than $200 including the cutting and programming process by a locksmith if necessary.</p>\r\n<p>One better way to replace your key immediately and can be cheaper than going to the dealer, you can call for a reputable and a trusted locksmith. Some locksmiths offer services that replace electronic keys on-site, fast. They will provide everything you need and get the job done efficiently. This way, it is much faster and affordable than a dealer.</p>', 'Electronic keys have become high-tech to improve the security of a car. Newer models of vehicles today features keys that have their transponder to communicate their matching cars. A car wont be able to start if the key used doesn''t match.', 'page', 'Car Key Replacement, Electronic Keys For Cars Replacement', 'Electronic keys have become high-tech to improve the security of a car. Newer models of vehicles today features keys that have their transponder to communicate their matching cars. A car wont be able to start if the key used doesn''t match.', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:45:51', '2017-10-17 04:26:02', '0000-00-00'),
(42, '24 Hour Locksmith', '24-hour-locksmith', '<h3><strong>24 Hour Emergency Locksmith Service</strong></h3>\r\n<p>You never know when a mishap or the inevitable might happen. You might be arriving your home from a party at 3 in the morning and all of a sudden your keys are not there. You&rsquo;re hopeless and began to panic until you did something foolish like breaking your window just to get in.</p>\r\n<p>We don&rsquo;t usually call for a locksmith on a daily basis or not very often, but at times like this is the most reasonable reason to call for a locksmith. Not many people require having their locks replace or install, lose and damage keys their keys every day. But they are our heroes when we need their service.</p>\r\n<p>24-hour emergency locksmiths are available anytime so that when you need them, they will be there to help you. Emergency or not, an emergency locksmith will get to your location as soon as possible so the customer won&rsquo;t wait too long or call for another service. They will arrive with their complete tools and equipment so any problems they encounter will be handled professionally and with expertise giving relief to the customer.</p>\r\n<p>So when there is a lock issue that needs to be resolved quickly, call for a reputable locksmith. 24-hour emergency locksmiths will always be at your disposal anywhere you are even at the oddest places and time.</p>', '24-hour emergency locksmiths are available anytime so that when you need them, they will be there to help you. Emergency or not, an emergency locksmith will get to your location as soon as possible so the customer wont wait too long or call for another service. ', 'page', '24 Hour Locksmith, 24 Hour Emergency Locksmith Service', '24-hour emergency locksmiths are available anytime so that when you need them, they will be there to help you. Emergency or not, an emergency locksmith will get to your location as soon as possible so the customer wont wait too long or call for another service. ', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:46:32', '2017-10-17 04:22:20', '0000-00-00'),
(43, 'Replacement Keys For Cars', 'replacement-keys-for-cars', '<h3>Replacement Keys For Cars With Chip</h3>\r\n<p>Over the years, there have been so many improvements with cars especially when it comes to security. An old vehicle may rely on its key for locking and the opening of doors and the ignition. While newer car models don&rsquo;t need to insert the key to unlock the door or start the car, but rather through the use of a remote. It improves the convenience and security of the car.</p>\r\n<p>Car keys today are not the same as the keys before. They are called transponder keys which contain chips to communicate with their matching cars. A transponder key has its own chip that has a unique code and will transmit this to the car&rsquo;s computer. When the code matches with the car, the car will start. Otherwise, if the code is wrong, then the car will not start.</p>\r\n<p>So what if you lose your transponder key? Surely, you will have a frustrating experience when this happens. You won&rsquo;t be able to access your car especially when it is the worst time like you&rsquo;re late for a job interview. But it&rsquo;s not just you who would lose the keys because it&rsquo;s more common than you think.</p>\r\n<p>You can quickly solve this solution by calling a professional locksmith. Locksmiths are not only for homes or building, but they also specialize in car locks. A locksmith has all the complete equipment and tools to provide you a replacement key and have the key program so that it could match your car. So don&rsquo;t let panic take over you completely, there&rsquo;s always a problem with every solution. Call your local locksmith to get your keys replaced.</p>', 'Car keys today are not the same as the keys before. They are called transponder keys which contain chips to communicate with their matching cars. A transponder key has its own chip that has a unique code and will transmit this to the cars computer. ', 'page', 'Replacement Keys For Cars, Replacement Keys For Cars With Chip', 'Car keys today are not the same as the keys before. They are called transponder keys which contain chips to communicate with their matching cars. A transponder key has its own chip that has a unique code and will transmit this to the cars computer. When the code matches with the car, the car will start. ', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:47:10', '2017-10-17 04:29:46', '0000-00-00'),
(44, 'Ignition Key Replacement', 'ignition-key-replacement', '<h3>Ignition Key Replacement Locksmith</h3>\r\n<p>The ignition key is used to start the car by inserting the key into the ignition switch. It is obviously needed to move the car. But sometimes, mishaps can happen like damaging your key or the switch, lost the key, stolen key, or problems with the lock cylinder such as getting your key stuck.</p>\r\n<p>This could be a huge problem especially when the key is a transponder that has a chip inside. You can&rsquo;t simply replace a transponder key because it the chip inside has a unique code that matches the car&rsquo;s computer. Using a key with the wrong chip won&rsquo;t start the car.</p>\r\n<p>For you to able to fix this problem, you can contact your trusted locksmith. A professional locksmith has all the equipment and tools he needs to make a replacement for your ignition key, transponder or not. This is more convenient than going to the dealership because it costs more and can take weeks to replace your key. A locksmith can get to your location wherever you are, and if they offer 24-hour emergency service, then you don&rsquo;t have to worry getting stranded in the late hours of an evening.</p>\r\n<p>So if you there&rsquo;s an issue with your ignition key, call for your local and reputable locksmith. They will get to your location as fast as they can and will provide you a working ignition key.</p>', 'The ignition key is used to start the car by inserting the key into the ignition switch. It is obviously needed to move the car. But sometimes, mishaps can happen like damaging your key or the switch, lost the key, stolen key, or problems with the lock cylinder such as getting your key stuck.', 'page', 'Ignition Key Replacement, Ignition Key Replacement Locksmith', 'The ignition key is used to start the car by inserting the key into the ignition switch. It is obviously needed to move the car. But sometimes, mishaps can happen like damaging your key or the switch, lost the key, stolen key, or problems with the lock cylinder such as getting your key stuck.', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:48:13', '2017-10-17 04:34:47', '0000-00-00'),
(45, 'Remote Car Keys Replacement', 'remote-car-keys-replacement', '<h3>Cheap Replacement Remote Car Keys</h3>\r\n<p>As a car owner, it is always vital to remember that your car keys are important. Without your keys, the car will not obviously start. But in case your keys got stolen, damaged, or lost, there are some options to consider in replacing your car keys. But for the majority of us, we will always go for the cheap option rather than spend a huge amount of cash just to replace a key.</p>\r\n<p>One option you can consider is going to the dealership depending on the brand of your car. There is no problem with dealerships replacing your keys, but the main concern is that it is expensive and time-consuming. Depending on the brand and model, it can take more than $200.</p>\r\n<p>The cheaper option is hiring a professional locksmith. No matter what type of key you have whether it is a regular key, key fob, or a transponder key, a professional locksmith can provide you a replacement on the same day you hire him. A locksmith won&rsquo;t need the original key if you can&rsquo;t provide one because it&rsquo;s part of their service for people who are getting a car lockout. They can even program your new key fob and transponder key to ensure it is compatible with the car.</p>\r\n<p>Rather than going to the dealership, call for your local locksmith. Not only it is affordable and cheaper, but you will also receive your newly replaced key quickly. Your locksmith will assure you that your key is fully compatible with your car.</p>', 'Remote Car Keys Replacement', 'page', 'Remote Car Keys Replacement, Cheap Replacement Remote Car Keys', 'Remote Car Keys Replacement', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:48:28', '2017-10-17 04:36:46', '0000-00-00'),
(46, 'Programmable Car Keys Replacement', 'programmable-car-keys-replacement', '<h3>Programmable Car Keys Replacement</h3>\r\n<p>It&rsquo;s vital for any car owner to secure their cars and be protected at all times. In the past, keys were simply keys that are used to open the locks and start the cars. Today, keys have chips inside them such as key fobs and transponder keys.</p>\r\n<p>The chip inside of a key emits a signal that matches the car&rsquo;s computer for it to start. If the wrong chip is used, then the car won&rsquo;t start. This has present many advantages that have been preventing any car from being stolen. But what if you lost your car keys?</p>\r\n<p>There is nothing to be worried about because you can call a professional locksmith to replace your car keys. Even if you don&rsquo;t have the original key, a locksmith can provide you a key and will program it to match your car. A locksmith has all the specialized tools and equipment ready for cutting and programming a car key.</p>\r\n<p>This is better than going to a dealership because it can get quite expensive and will take weeks before obtaining your key while a locksmith can work on your key on the same day. So if you need any key to be programmed, call your local locksmith and he will do the job for you.</p>', 'Its vital for any car owner to secure their cars and be protected at all times. In the past, keys were simply keys that are used to open the locks and start the cars. Today, keys have chips inside them such as key fobs and transponder keys.', 'page', 'Programmable Car Keys Replacement', 'Its vital for any car owner to secure their cars and be protected at all times. In the past, keys were simply keys that are used to open the locks and start the cars. Today, keys have chips inside them such as key fobs and transponder keys.', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:48:42', '2017-10-17 04:42:06', '0000-00-00'),
(47, 'Car Key Programming', 'car-key-programming', '<h3>Replacement Car Keys With Chips</h3>\r\n<p>Transponder keys have been around since the mid-1990s. Since then, almost all cars operate with transponder keys and car theft incidents has decreased because of the improved security.</p>\r\n<p>A transponder key contains a chip inside that is used to transmit a signal to the receiver that is located inside of the ignition. With each chip has their unique code, the car can be started if the correct code was sent. If the wrong code was transmitted to the receiver of the car, then the car is unable to be started. This could be a very frustrating experience if you lost your car key.</p>\r\n<p>Replacing a car key with a chip is not easy as replacing a regular key. You can replace your keys by going to a dealership but it can get expensive, and it takes time just to replace your key. Not to mention the towing service you have to pay to take your car to the dealership.</p>\r\n<p>But you still have another choice, and that is hiring a professional locksmith. Car keys with chips inside are not a problem for a locksmith because they have the equipment and tools to provide a new key. Not to worry about the chip because a locksmith also can program chips ensuring you that you&rsquo;ll have a fully functional key that will match to your car. This is surely a more affordable way to replace your car key than going to a dealership.</p>', 'A transponder key contains a chip inside that is used to transmit a signal to the receiver that is located inside of the ignition. With each chip has their unique code, the car can be started if the correct code was sent. ', 'page', 'Car Key Programming, Replacement Car Keys With Chips', 'A transponder key contains a chip inside that is used to transmit a signal to the receiver that is located inside of the ignition. With each chip has their unique code, the car can be started if the correct code was sent. ', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:49:30', '2017-10-17 04:44:01', '0000-00-00'),
(48, 'High Security Residential Locks', 'high-security-residential-locks', '<h3>High-Security Residential Locks</h3>\r\n<p>If you take security and safety seriously, you should first start looking at your front door and its locks. Regular locks are like no locks at all. You could be putting your family and possessions&rsquo; at risk. Even an amateur can pick these locks in a matter of seconds. And people with no skills can just use brute force to break these locks. Knowing these locks could compromise your security, the best solution for this is installing high-security locks.</p>\r\n<p>Just like how they are called, high-security locks are much better than regular locks. They are remarkably secure and reliable because they are made of high-quality materials like hardened steel. All of these have high resistance against jimmy objects or any form of physical attack. You can assure that your family and home will be safe against any break-ins.</p>\r\n<p>With high-security locks, you can sleep peacefully at night and have a peace of mind that no intruder will break in your home. They are hard to pick and great for resisting drill attack. Not to mention their long lasting materials to provide you years of protection and security. So don&rsquo;t just go for any old regular locks, replace them with high-security locks to avoid any risks of intruders.</p>', 'Just like how they are called, high-security locks are much better than regular locks. They are remarkably secure and reliable because they are made of high-quality materials like hardened steel. ', 'page', 'High Security Residential Locks', 'Just like how they are called, high-security locks are much better than regular locks. They are remarkably secure and reliable because they are made of high-quality materials like hardened steel. ', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:49:45', '2017-10-17 04:45:22', '0000-00-00'),
(49, 'Car Key Cutting', 'car-key-cutting', '<h3>Car Key Cutting And Programming</h3>\r\n<p>For once as a car owner, we need to have our keys cut and programmed. It could be because we lose them, damaged them, or we just need to have a copy. But some cars today require keys that have chips inside them. These are either remote controllers, key fobs, or transponder keys. These special type of keys have transmissions inside them that emit signals to their cars. And each chip has their unique code that corresponds to their matching cars.</p>\r\n<p>When these keys inserted into the ignition, as long as the code is correct, the car will start. Otherwise, if the wrong code was used, the car will not start. So if you need your car keys to be replaced or duplicated, you can go to your dealer. It is a good idea until you will realize that it is expensive and can take a few weeks to receive your key.</p>\r\n<p>Instead, you can go to your local professional locksmith to have your key cut and programmed. Whether or not you have the original key you want to be duplicated; a reputable locksmith can do the job done. He&rsquo;ll provide you the key, have it cut and then program it with his specialized tools and equipment.</p>\r\n<p>Not only this is cheaper, but it''s also more convenient too because some locksmiths offer mobile services. They can go to your location and receive your key on the same day.</p>', 'Whether or not you have the original key you want to be duplicated; a reputable locksmith can do the job done. Hell provide you the key, have it cut and then program it with his specialized tools and equipment.', 'page', 'Car Key Cutting, Car Key Cutting And Programming', 'Whether or not you have the original key you want to be duplicated; a reputable locksmith can do the job done. Hell provide you the key, have it cut and then program it with his specialized tools and equipment.', NULL, NULL, NULL, 'admin', 1, 1, '2017-10-16 03:50:31', '2017-10-17 04:46:43', '0000-00-00');
